import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Escritorio = () => {
    const [triajeList, setTriajeList] = useState([]);
    const [planList, setPlanList] = useState([]);

    useEffect(() => {
        const fetchTriaje = async () => {
            try {
                const token = localStorage.getItem('token');
                const result = await axios.post(
                    'http://localhost:3002/api/escritorio/listarTriaje',
                    {},
                    {
                        headers: {
                            Authorization: `Bearer ${token}`
                        }
                    }
                );
                console.log('Triaje response', result.data);
                setTriajeList(result.data);
            } catch (error) {
                console.error('Error fetching Triaje:', error);
            }
        };

        const fetchPlan = async () => {
            try {
                const token = localStorage.getItem('token');
                const result = await axios.post(
                    'http://localhost:3002/api/escritorio/listarPlan',
                    {},
                    {
                        headers: {
                            Authorization: `Bearer ${token}`
                        }
                    }
                );
                setPlanList(result.data);
            } catch (error) {
                console.error('Error fetching Plan:', error);
            }
        };

        fetchTriaje();
        fetchPlan();
    }, []);

    return (
        <div>
            <div>
                <h2>Triaje</h2>
                <table>
                    <thead>
                    <tr>
                        <th>#</th>
                        <th>Paciente</th>
                    </tr>
                    </thead>
                    <tbody>
                    {triajeList.map((item, index) => (
                        <tr key={index}>
                            <td>{index + 1}</td>
                            <td>{item.paciente}</td>
                        </tr>
                    ))}
                    </tbody>
                </table>
            </div>
            <div>
                <h2>Plan</h2>
                <table>
                    <thead>
                    <tr>
                        <th>#</th>
                        <th>Paciente</th>
                    </tr>
                    </thead>
                    <tbody>
                    {planList.map((item, index) => (
                        <tr key={index}>
                            <td>{index + 1}</td>
                            <td>{item.paciente}</td>
                        </tr>
                    ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default Escritorio;
